import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import TextField from '@material-ui/core/TextField';
import Card from '@material-ui/core/Card';
import Box from '@material-ui/core/Box';


  const useStyles = makeStyles((theme) => ({
    root: {
      '& > *': {
        margin: theme.spacing(1),
        width: '25ch',
      },
    },
    box: {

      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      marginTop: '5%',
      marginLeft: '20%',
      marginRight: '20%',
      textAlign: "center"
    },
    card: {

      display: "flex",
      flexDirection: "column",
      justifyContent: "center",
      marginTop: '5%',
      marginLeft: '20%',
      marginRight: '20%',
      textAlign: "center"
    }
  }));

  export default function BasicTextFields() {
    const classes = useStyles();

    return (
      <form className={classes.root} noValidate autoComplete="off">
        <Box Container className={classes.box}>
        <Card>
        <TextField id="outlined-basic" label="Organisation" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Department" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Team Name" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Industry" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Sub Industry" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Team Function" variant="outlined" />
        <br/>
        <TextField id="outlined-basic" label="Stakeholders" variant="outlined" />
        </Card>
        </Box>
      </form>
    );
  }
